import React from "react";

export default class Model extends React.Component{
    constructor(props) {
        super(props);
        console.log(props);
        console.log("In Model");
        
    }


    render() {
        return (
            <div className = "Model">
                <div class="card">
                    <ul class="list-group list-group-flush">
                       {props.results}
                    </ul>
                </div>
            </div>
        )
    }
}
